import React,{Component} from 'react';

class DropdownItem extends Component {
    render() {
        return (
            <li className={this.props.DropInfo.className}><a href={this.props.DropInfo.href}>{ this.props.DropInfo.button }</a></li>
        )
    }
};

export default DropdownItem;
